import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Electronics category card (home page grid)
    const electronicsCardSelector = '.category-card:has-text("Electronics")';
    await page.waitForSelector(electronicsCardSelector, { timeout: 5000 });

    // Click the Electronics category card
    await page.click(electronicsCardSelector);

    // Wait for the category results header to appear
    await page.waitForSelector('h2', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract the category header and product titles for verification
    const categoryHeader = await page.textContent('h2');
    const productTitles = await page.$$eval('.product-title', nodes => nodes.map(n => n.textContent.trim()));

    return {
      success: true,
      action: "Navigated to Electronics category via category card on homepage",
      extractedData: {
        categoryHeader,
        productTitles: productTitles.slice(0, 5)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
